import React from 'react';
import img1 from "./Pictures/img1.jpg";


const Card = (props)=>{
    return(
        <div className="card text-center">
            <div className="overflow">
               <img src={img1} alt=" "/>
                </div>
                <div className="card-body text-dark">
                    <h1 className="card-title">Social Card</h1>
                </div>
            </div>
    )
}

export default Card;
